test('should create a Contract', async () => {
    const provider = new HttpProvider(ChainIds.Privatenet);
    const erc20Contract = new Contract(ERC20ContractAddress, ERC20ContractABI, provider);

    expect(erc20Contract).not.toBe(null);
});





test('should get name (LOL) from ERC20 Contract [via signer]', async () => {
    const provider = new HttpProvider(ChainIds.Privatenet);
    const privateKey = "0xc88b2d8a81ceea76b41e005556c1c77c0062a5ba0566a1fe214770f485adde4f";
    const wallet = new Wallet(privateKey, provider);

    const erc20Contract = new Contract(ERC20ContractAddress, ERC20ContractABI, wallet);
    const name = await erc20Contract.name();

    expect(name).toBe("LOL");
});

