test('should send 1 ERC20 token to 0x1c434faffabde5ed77415f61218bbbf4b902f39c from ERC20 Contract [via signer]', async () => {
    const provider = new HttpProvider(ChainIds.Privatenet);
    const privateKey = "0xc88b2d8a81ceea76b41e005556c1c77c0062a5ba0566a1fe214770f485adde4f";
    const wallet = new Wallet(privateKey, provider);
    const erc20Contract = new Contract(ERC20ContractAddress, ERC20ContractABI, wallet);

    const result = await erc20Contract.transfer("0x7cccbeeff2096a46385611f8d236cb23be3edcb8", 1);

    expect(result.hash).not.toBe(null);
});






